// src/App.tsx
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import RequestRide from './pages/RequestRide';
import RideOptions from './pages/RideOptions';
import TravelHistoryPage from './pages/TravelHistoryPage';


const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/solicitacao" element={<RequestRide />} />
        <Route path="/opcoes" element={<RideOptions />} />
        <Route path="/historico" element={<TravelHistoryPage />} />
      </Routes>
    </Router>
  );
};

export default App;
